import React, { Component } from 'react';

import { NavLink } from 'react-router-dom';

export default class Navbar extends Component {
  constructor(props) {
    super(props);
    this.state = {
      title: 'DeskAnalyst System',
      icon: 'fa fa-futbol',
      permssionUser: '',
    };
  }
  componentDidMount() {
    const user = JSON.parse(sessionStorage.getItem("loginUser"))
    if(!user) {
      this.props.history.push('/')
    }else {
      this.setState({permssionUser: user.teamName})
    console.log(this.state.permssionUser)
    }
  }
  render() {
    const { icon, teamName, title } = this.state;
    return (
      <nav className='navbar bg-primary'>
        <h1>
          <i className={icon} /> {title}{' '}
        </h1>{' '}
        <ul>
          <li>
            <NavLink
              to='/Dashboard'
              exact
              activeStyle={{
                color: 'blue',
              }}>
              {' '}
              Home{' '}
            </NavLink>{' '}
          </li>{' '}
          <li>
            <NavLink
              to='/TeamSqoud'
              exact
              activeStyle={{
                color: 'blue',
              }}>
              {' '}
              Team Sqoud{' '}
            </NavLink>{' '}
          </li>{' '}
          <li>
            <NavLink
              to='/Match'
              exact
              activeStyle={{
                color: 'blue',
              }}>
              {' '}
              Match{' '}
            </NavLink>{' '}
          </li>{' '}
          <li>
            <NavLink
              to='/CreateMatch'
              exact
              activeStyle={{
                color: 'blue',
              }}>
              {' '}
              Create - Match{' '}
            </NavLink>{' '}
          </li>{' '}
        </ul>{' '}
      </nav>
    );
  }
}
